import "antd/dist/antd.css";
import { Component } from "react";
import Proptypes from "prop-types";

const App = ({ Component }) => {
  return <Component></Component>;
};

App.propTypes = {
  Component: Proptypes.elementType.isRequired,
};

export default App;
